Verenigde Staten
Horror
126 minuten

een zeer goeie film

met Thomas Jane, Marcia Gay Harden en William Sadler

Nadat het kleine plaatsje Bridgton getroffen wordt door een hevige storm, verschijnt een mysterieuze mist. David Drayton 
(Thomas Jane) en diens zoontje worden, net zoals vele andere dorpelingen verrast door de mist terwijl ze inkopen doen. Al snel 
blijkt de mist een dekmantel, waarin de meest vreemde en gevaarlijke wezens zich verstopt hebben. Drayton vreest voor zijn 
leven en voor dat van zijn kind en probeert met alle macht te overleven...
